  if [ ! -f ${FRAG_STORE_DIR}.tar.gz ]; then
    echo "Err: couldn't extract compressed frag store"
    exit 1
  fi

  tar zxvf ${FRAG_STORE_DIR}.tar.gz > /dev/null 2>&1 

